import styles from "./css/ErrorPage.module.css";

const ErrorPage = () => {
  return (
    <div>
      <h2>404</h2>
      <h3>Look like you're lost</h3>
      <p>the page you are looking for not available!</p>
      <button>Go to Home</button>
    </div>
  );
};

export default ErrorPage;
